import * as React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import 'react-native-gesture-handler';
import { v4 as uuidv4 } from 'uuid'; // Importar a função v4 do uuid

// Importar os componentes das telas
import LoginScreen from './LoginScreen';
import CadastroScreen from './CadastroScreen';
import HomeScreen from './HomeScreen';

const Stack = createStackNavigator();

function App() {
  // Gerar um ID único para o nome da rota de carregamento
  const loadingRouteName = `Loading-${uuidv4()}`;

  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName={loadingRouteName} screenOptions={{ headerShown: false }}>
        {/* Adicionar a tela de carregamento com o ID único gerado */}
        <Stack.Screen name={loadingRouteName} component={LoadingScreen} />
        <Stack.Screen name="Login" component={LoginScreen} />
        <Stack.Screen name="Cadastro" component={CadastroScreen} />
        <Stack.Screen name="Home" component={HomeScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

// Criar a tela de carregamento
function LoadingScreen() {
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Text>Loading...</Text>
    </View>
  );
}

export default App;
